I'm trying to create a rust app that can read the contents of the clipboard aloud using the elevenlabs.io api. I've been looking at the documentation for the elevenlabs.io api and the `clipboard` crate, but I'm not sure how to put it all together.

Here's what I have so far:

```
use clipboard::ClipboardProvider;
use reqwest::Client;
use serde::Deserialize;
use std::error::Error;

#[derive(Deserialize)]
struct TextToSpeechResponse {
    audio: String,
}

async fn text_to_speech(text: &str) -> Result<String, Box<dyn Error>> {
    let client = Client::new();
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json::<TextToSpeechResponse>()
        .await?;

    Ok(response.audio)
}

fn main() -> Result<(), Box<dyn Error>> {
    let text = ClipboardProvider::new().get_contents()?;
    let audio = text_to_speech(&text).await?;
    // How do I play the audio now?
    Ok(())
}
```

I'm not sure how to play the audio after I get the response from the API. I've looked at the `rodio` crate, but I'm not sure how to use it to play the audio data that I get from the API.

Any help would be greatly appreciated!

## Answer (1)

You can use the `rodio` crate to play the audio data. Here's an example of how you can modify your code to play the audio:

```
use clipboard::ClipboardProvider;
use reqwest::Client;
use serde::Deserialize;
use std::error::Error;
use rodio::{Decoder, Sink, Source};

#[derive(Deserialize)]
struct TextToSpeechResponse {
    audio: String,
}

async fn text_to_speech(text: &str) -> Result<String, Box<dyn Error>> {
    let client = Client::new();
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json::<TextToSpeechResponse>()
        .await?;

    Ok(response.audio)
}

fn main() -> Result<(), Box<dyn Error>> {
    let text = ClipboardProvider::new().get_contents()?;
    let audio = text_to_speech(&text).await?;
    let (_stream, stream_handle) = rodio::OutputStream::try_default()?;
    let sink = Sink::try_new(&stream_handle)?;

    let source = Decoder::new(audio.as_bytes())?;
    sink.append(source.convert_samples());
    sink.sleep_until_end();

    Ok(())
}
```

